import './App.css';

function App() {
  const title = "Welcome to the blog";
  const likes = 50;
  const link = "http://www.gogle.com";
  // const person = {name:'anas',age:30};
  return (
    <div classname = "App">
      <div classname = "content">
        <h1>{title}</h1>
        <p>Liked{likes}times</p>

        <p>{10}</p>
        <p>{"hello,ninjas"}</p>
        <p>[1,2,3,4,5]</p>
        <p>{Math.random()*10}</p>
        <a href={link}>Google Site</a>
      </div>
    </div>

  );
}

export default App;
